import styled from '@emotion/styled'

export const Table = styled.table`
margin: 0 auto;
width: 300px;
`
export const TableHead = styled.tr`
background-color: #2bbcd4;
color: #dafaff;
text-transform: uppercase;
`

export const TableHeadItem = styled.th`
padding: 10px 0;
width: 110px;
`
